// frontend/src/components/TimelineGraph.js

import React, { useState, useEffect } from 'react';
import axios from 'axios';


const TimelineGraph = () => {
  const [data, setData] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await axios.get('http://localhost:3000/data');
        setData(response.data);
      } catch (error) {
        console.error('Error fetching data:', error);
      }
    };

    fetchData();
  }, []);

  return (
    <div>
      <h2>Timeline Graph</h2>
      <div className="timeline">
        {data.map((item, index) => (
          <div
            key={index}
            className={item.machine_status === 0 ? 'yellow' : item.machine_status === 1 ? 'green' : 'red'}
            style={{
              width: '10px', // Adjust width as needed
              height: '20px', // Adjust height as needed
              display: 'inline-block',
            }}
            title={`Timestamp: ${item.ts}, Machine Status: ${item.machine_status}, Vibration: ${item.vibration}`}
          />
        ))}
      </div>
    </div>
  );
};

export default TimelineGraph;
